import React from "react";
import {Route} from "react-router-dom";
import ExploreScreen from "./ExploreScreen/ExploreScreen";
import HomeScreen from "./HomeScreen/HomeScreen";
import ProfileScreen from "./ProfileScreen/ProfileScreen";
//import who from "../../../reducers/who";
import tweets from "../../../reducers/tweets";
//import profile from "../../../reducers/profile";
import {/*combineReducers,*/ createStore} from "redux";
import {Provider} from "react-redux";

//const reducer = combineReducers({tweets, who, profile})
//const store = createStore(reducer);
const store = createStore(tweets);

const Build = () => {
  return(
      <Provider store={store}>
        <div>
          <Route path="/a7/twitter/home" exact={true} component={HomeScreen}/>
          <Route path="/a7/twitter/explore"  component={ExploreScreen}/>
          <Route path="/a7/twitter/profile"  component={ProfileScreen}/>
        </div>
      </Provider>
  )
};

export default Build;
